import React from 'react';

const Experience = () => {
  return (
    <section className="experience-section p-6">
      <h2 className="text-2xl font-bold mb-4">Experience Section</h2>
      <p>This is the Experience component content.</p>
    </section>
  );
};

export default Experience;
